            Eselfware Scada bir Ener Otomasyon organizasyonudur. Uzman ve dinamik kadrosuyla müşterilerine ihtiyaçları doğrultusunda en iyi hizmeti vermek için kurulmuştur. Ener Otomasyon 15 yılı aşan deneyimli kadrosuyla Yazılım, Senkronizasyon, Enerji Otomasyonu ve Endüstriyel Kontrol konularında mühendislik, danışmanlık, satış, servis ve eğitim hizmetleri vermektedir. Eselfware bu kapsamda gelişen teknolojiler ile uyumlu olarak Endüstri 4.O, Iot, ERP ve Scada yazılımları konusunda arge yatırımlarında bulumuştur.  Tamamen yerli ERP ve SCADA yazılımları ile sektördeki önemli bir açığı gidermiştir. Eselfware'i farklı kılan; deneyimli kadrosu, güçlü mühendislik alt yapısı ve müşteri memnuniyetini");
