                            <p class=""fadeInUp"" data-wow-delay=""0.4s"">Bünyesinde enerji , tekstil ve metal sanayi sektöründe yer alan firmalar barındıran UCK Group, yepyeni bir bakış açısıyla geleceğe yatırım yapmaya devam ediyor. ""Enerjimiz hiç tükenmeyecek "" sloganıyla yola çıkan UCK Group'un Solar panel üretimi alanında UCK Solar Panel; Proje Danışmanlı ve anahtar teslim santral kurulum hizmeti alanında UCK Enerji ile Türkiye'nin enerji ihtiyacını karşılamaya ve yenilenebilr enerji kaynaklarına yatırım yapıyor. Bu ");
            WriteLiteral(@"kapsamda Türkiye'nin dörtbir yanında  solar enerji santralleri kurulumu yapmaktadır. Her santral farklı bir lokasyonda olduğu için santral panellerin performanslarının takibi, arıza durumlarının izlenmesi ve proaktif çözümler sunulabilmesi açısından önem arz etmektedir. Her santralin başında teknik bir personel bulundurmak hem maliyeti artırmakta hemde tüm senaryoları analiz edebilecek bir teknik personelin sair bölgelerde sürekli istihdamı sağlanamamaktadır. Alanında Türkiye'nin saygın firmalarından olan <strong>UCK Group</strong> bu konuda <strong>Eselfware</strong> ile işbirliğine gitmiş ve scada sistemleri firmamız tarafından yapılmıştır. Böylece bütün santraller tek merkez monitör edilmekte alarm durumları, performans takibi web tabanlı sistemler sayesinde şirket merkezinden anlık olarak takip edilebilmektedir. Bu kapsamda UCK Group hem büyük bir maliyet avantajı sağlamış hemde performans takibi konusunda dünyanın önde gelen <strong>Scada</strong> teknolojilerini kullanarak rekabet avantajı elde etmiştir");
